app.use(bodyParser.json());
app.use(bodyParser.urlencoded({extended : true}));
app.use(helmet());
app.use(morgan("dev"));

app.get("/", handleRoot);

app.get("/profile", handleProfile);

app.listen(PORT, handleListening);

